					CALL MANTENIMIENTO_CUENTA (@CUE_Codigo,NULL,NULL,NULL,NULL,NULL,NULL,@CUE_FlagEstadoPago,@CUE_FechaCanc,NULL,NOW(),NULL,1, 1, NULL, NULL, NULL, NULL, NULL);

