					DECLARE INDICEPOSICIOND INT(11) DEFAULT  0;
					DECLARE COMPROBANTED_CURSORMODI cursor for 
					SELECT 
					CCD.CPDEP_Codigo AS CPDEP_Codigo,
					CCD.CPP_Codigo AS CPP_Codigo,
